Oskari.debug_stats = function() {
	var count = 0;
	for ( var n = 0, len = debug_files.length; n < len; n++) {
		var itm = debug_files[n];

		if (itm.context == 'loadCall')
			count++;
	}

	var count_created = 0;
	var count_requires = 0;
	var count_extras = 0;

	var createdClasses = {};
	var requiredClasses = {};
	var extraClasses = {};

	for ( var n = 0, len = debug_classes.length; n < len; n++) {
		var itm = debug_classes[n];

		if (itm.created) {
			count_created++;
			createdClasses[itm.created] = true;
		}
		if (itm.require) {

			if( itm.require.length ) {
			for ( var i = 0; i < itm.require.length; i++) {
				var req = itm.require[i];
				if (requiredClasses[req])
					continue;
				requiredClasses[req] = true;
				count_requires++;
			}
			} else {
				requiredClasses[itm] = true;
				count_requires++;
			}

		}
	}

	for (e in debug_extras) {
		if (requiredClasses[e])
			continue;
		extraClasses[e] = true;
		count_extras++;
	}

	console.log("================== Loaded " + count + " files");
	console.log("================== Created " + count_created + " classes");
	console
			.log("================== Resolved Required Classes"
					+ count_requires);
	console.log("================== Created Unreferenced Classes"
			+ count_extras);

	var clsssForInclusion = [];
	var clsssForExclusion = [];

	for ( var n = 0, len = debug_classes.length; n < len; n++) {
		var itm = debug_classes[n];

		if (itm.created)
			clsssForInclusion.push(itm.created);
	}
	for (e in extraClasses) {
		clsssForExclusion.push(e);
	}
	return {
		include : clsssForInclusion,
		exclude : clsssForExclusion
	};
}

Oskari.ExtClasses = [];

Oskari.ExtSelector = Oskari.ExtSelector || {};
// Oskari.ExtExcludes = Oskari.ExtExcludes||{};

Oskari.ExtDefine = function() {

	var className = arguments[0];
	Oskari.ExtClasses.push(className);
	if (Oskari.ExtExcludes) {
		if (Oskari.ExtExcludes[className]||Oskari.ExtExcludes['*'] && 
				(!Oskari.ExtSelector || !Oskari.ExtSelector[className]) ) {
			console.log("DEFINE / ignore EXTRA", className);
			return;
		} else {
			console.log("DEFINE / EXTRA not Exluded", className);
		}
	} else if (!Oskari.ExtSelector || !Oskari.ExtSelector[className]) {
		console.log("DEFINE / EXTRA", className);
		debug_extras[className] = true;
	} else {
		console.log("DEFINE", className);
	}
	return Ext.define.apply(Ext, arguments);
}

