(function() {

	/*
	 * 
	 */
	var metas = Oskari.clazz.metadata('Oskari.ext.Quickie');

	var deps = metas.meta.source.classDependencies;
	var dmap = metas.meta.source.classesToPaths;

	var requirements = {};

	var fileList = [];

	for ( var d = deps.length - 1; d >= 0; d--) {
		var itm = deps[d];
		var cls = null;
		var cfn = null;
		if (itm.length) {
			for ( var i = itm.length - 1; i >= 0; i--) {
				cls = itm[i];

				requirements[cls] = true;

			}
		} else {
			cls = itm;

			requirements[cls] = true;
		}

	}

	for ( var f = 0; f < metas.meta.source.loadOrder.length; f++) {
		var itm = metas.meta.source.loadOrder[f];
		if (requirements[itm])
			fileList.push( {
				"type" : "text/javascript",
				"cls" : itm,
				"src" : dmap[itm]
			});
	}

	metas.temp = {
		requirements : requirements,
		fileList : fileList
	};

	var scripts = metas.meta.source.scripts;
	var sources = {};
	for ( var n = 0, len = scripts.length; n < len; n++) {
		var fn = scripts[n].src;
		if (sources[fn])
			throw "Duplicate Script " + fn;

	}

})();
